import { useEffect, useState } from "react";
import { getMyHistory } from "../services/api";

export default function History({ token }) {
  const [items, setItems] = useState([]);

  useEffect(() => {
    getMyHistory(token).then(setItems);
  }, [token]);

  return (
    <div className="container">
      <h1>История</h1>

      {items.map((i) => (
        <div className="result" key={i.id}>
          <p>{i.created_at}</p>
          <strong>{i.dose} ЕД</strong>
          <p>{i.interpretation}</p>
        </div>
      ))}
    </div>
  );
}
